import "./App.css";

function App() {
  const person = ["Justin", "Nick", "Nancy", "Tony", "Atlas"];

  return (
    <div className="App">
      <h1>Hello World!</h1>
      {person.map((peep) => {
        return <li>{peep}</li>;
      })}
    </div>
  );
}

export default App;
